import React from 'react';

import './style.css';

export default function ModalCar(props) {
    return (
        <div style={style.parentDiv}>
            <div style={style.modalDiv}>

            </div>
        </div>
    )
};

const style = {
    parentDiv: {
        backgroundColor: "rgb(163, 163, 163,0.8)",
        position: "absolute",
        zIndex: 10,
        width: "100%",
        height: "100%",
        display:"flex",
        justifyContent: "center",
        alignItems: "center",
    },

    modalDiv:{
        backgroundColor:"#fffafa",
        width:"50%", 
        height: "450px"
    }
};
